      <h2 class="section1">Story</h2>
      <p class="contents ">In this cave lived the Necormacer who went by the name of <a href="Topic_23.xhtml">Lord of Lance Rock</a>.</p>
      <p class="contents ">When the heroes found him he was worshiping this image of <a href="Topic_22.xhtml">The Evil Eye</a>.</p>
